import React from "react"

function checkQuestion(props)
{
    if(props.question != "undefined"){
        return (
        <p>
            Question: {props.question}
        </p>)
    }
}
function Joke(props){
    console.log(props.question);
    return(
        <div className="joke">

            <p>Question: {props.question}</p>
            <p>Punch: {props.punch}</p>
        </div>
        
    )
    
}
export default Joke
